<!DOCTYPE html>
<html>
<head>
    <title>Vector Map</title>
    <style>
        html, body {
    margin: 0;
    padding: 0;
    width: 100%;
    height: 100%;
    overflow: hidden;
}

#map-container {
    width: 100%;
    height: 100%;
    border: 2px solid black;
    padding: 5px;
    box-sizing: border-box;
    display: flex;
    justify-content: center;
    align-items: center;
    margin: 0 auto;
    transform-origin: center center; /* 초기 중심점 설정 */
}

#map {
    width: 100%;
    height: 100%;
}

.subdivision {
    fill: #989898;
    transition: fill 0.3s;
}

#tooltip {
    position: absolute;
    background-color: white;
    border: 1px solid black;
    padding: 2px;
    z-index: 1000;
    font-size: 12px;
    display: none;
    transition: opacity 0.3s ease-in-out;
    opacity: 0;
}

#tooltip.show {
    opacity: 1;
}

/* SVG 텍스트를 선택할 수 없게 설정 */
text {
    user-select: none;
    -webkit-user-select: none; /* Safari */
    -moz-user-select: none; /* Firefox */
    -ms-user-select: none; /* Internet Explorer/Edge */
}

#toggle-buttons {
    position: fixed;
    bottom: 10px;
    left: 10px;
    z-index: 1000;
    margin-top: 10px;
    text-align: center;
    display: flex; /* 버튼들을 나란히 배치 */
    gap: 10px; /* 버튼 사이 간격 */
}

#toggle-buttons button {
    font-size: 12px;
    padding: 10px 20px;
}

#leading-party-toggle { /* 주요 정당 토글 버튼 */
    display: none; /* 처음에는 숨김 */
}

#minimize-button {
    position: absolute;
    top: 7px;
    right: 5px;
    background-color: transparent;
    border: none;
    cursor: pointer;
    font-size: 10px;
    color: gray;
    z-index: 10;
}

#info-box {
    position: absolute;
    top: 5px;
    right: 8px;
    width: 500px;
    height: auto;
    background-color: rgba(255, 255, 255, 0.8);
    border: 1px solid #ccc;
    padding: 10px;
    box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
    font-size: 12px;
    overflow: hidden;
    display: none;
    transition: width 0.3s, height 0.3s, padding 0.3s;
}

#info-box.minimized {
    width: 30px;
    height: 30px;
    padding: 0;
}

#info-box.minimized h3,
#info-box.minimized #info-content,
#info-box.minimized div,
#info-box.minimized div p {
    display: none;
}

#info-box.minimized h3 {
    font-size: 0; /* 최소화된 상태에서 제목 숨기기 */
}
    </style>
</head>
